        "SKIN-URI PERSONALIZATE

Când cumpărați Skin-uri personalizate, calitatea imaginii va scădea, dar acest lucru nu este de mare importanță și este normal (aproape nicio diferență când jucați). Iată statusul și semnificațiile sale:

În Revizuire (Galben): Înseamnă că Skin-ul este în curs de revizuire. Trebuie să așteptați ca acesta să fie aprobat.

Aprobat (Verde): Skin-ul a fost aprobat și poate fi văzut de alți jucători.

Reimbursat (Portocaliu): Ai primit o rambursare a Skin-ului, deoarece nu corespunde standardelor stabilite. Trebuie să selectați altă imagine care nu este aceeaşi.

Respins (Roșu): Înseamnă că Skin-ul nu poate fi văzut de alți jucători deoarece conține conținut neadecvat. Nu vei primi plasmă în return.



DE CE SKIN-UL MEU A FOST RAMBURSAT SAU RESPINS?

Dacă Skin-ul tău personalizat este rambursat, nu mai cumpărați deoarece va fi respins și vă veți pierde plasma.

Aceasta este o listă de lucruri care sunt *INTERZISE* de utilizat în Skin-urile personalizate. Dacă cumpărați un Skin cu aceasta, acesta va fi rambursat sau respins:
- Conținut și/sau referință sexuală;
- Skin-uri/Arte Nebuloase nemodificate;
- Conținut Gore/Sinucidere;
- Nuduri (fără tricou);
- Skin-uri foarte închise la culoare;
- Skin-uri transparente;
- Droguri (alcool/țigări/marijuana);
- Nume de pagini pentru adulți (pornografie);
- Persoane cu haine decoltate (decolteuri pe corp);
- Rasism/Nazism/Violență;
- Persoane care folosesc o armă;
- Semne obscene cu mâinile."

"Skin-ul tău personalizat nu a fost aprobat. Aici sunt motivurile mai comune pentru acest lucru. NU poți trimite:

        1. Fotografie de cineva fără haină;
        2. Cineva într-o postură sau scenă sugestivă;
        3. Reprezentare de alcool sau droguri (inclusiv marijuana);
        4. Arte de Nebulous care existe deja precum skin-urile nivelului. Acest lucru trebuie să fie modificat într-un mod semnificativ.

Dacă trimiți un skin care nu a fost aprobat de mai multe ori, va duce la mai multe penalități sau un ban."

"Autentifică-vă pentru acces multijucătorul. Poți:

- Juca sau comunica cu jucătorile în întreaga lume;
- Împartează progresul tău cu alte persoane;
- Crează și decorează un profil;
- Cumpăra plasmă în shop-ul;
- Încerca skin-uri generate de utilizatori.

Dacă nu vrei să autentificați, poți încă juca în mod single-player."
